(435, 'pusillanimous', '(adj)', 'lacking in courage and manly strength and resolution; contemptibly fearful', 'poor-spirited,unmanly', '#FINANCIAL editor Alex Brummer wrote: The great curiosity in the Mirrorgate affair is the pusillanimous attitude of the Trinity Mirror board.', 'http://img.tfd.com/wn/B4/17DB94-pusillanimous.jpg', 'http://www.thefreedictionary.com/pusillanimous', 0, 1),
(436, 'quagmire', '(n)', 'a soft wet area of low-lying land that sinks underfoot', 'mire,quag,morass,slack', 'The rock climber was stuck in one heck of a quagmire.', 'http://s3.amazonaws.com/brainyflix/photos/5926/thumb.jpg', 'http://www.gotbrainy.com/words/quagmire', 0, 1),
(437, 'quail', '(n)', 'flesh of quail; suitable for roasting or broiling if young; otherwise must be braised', 'shrink, cringe, flinch, shake, faint, tremble, quake, shudder, falter, droop, blanch, recoil, cower, blench, have cold feet', 'We had quail for dinner.', 'http://vocabmadeeasy.com/wp-content/uploads/2010/10/quail.jpg', 'http://vocabmadeeasy.com/2010/10/q-list-1-5/', 0, 3),
(438, 'qualm', '(n)', 'uneasiness about the fitness of an action', 'scruple,misgiving', '#I had forgotten them all so quickly, and I had a sudden qualm that all might not be well.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2012/06/qualm.jpg&h=300&zc=0', 'http://wordpandit.com/2012/Qualm', 0, 2),
(439, 'quiescent', '(adj)', 'not active or activated', 'quiet, still, peaceful, calm, resting, smooth, silent, serene, tranquil, dormant, latent, motionless, placid, undisturbed, inactive, unruffled, unmoving, in abeyance, unagitated', '#We do not intend to remain_temp quiescent within this unacceptable and unstable situation.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2011/08/quiescent.gif&h=300&zc=0', 'http://wordpandit.com/2011/Quiescent', 0, 2),
(440, 'quorum', '(n)', 'a gathering of the minimal number of members of an organization to conduct business', '', '#Frequency of meetings and quorum 1. The Committee recommends that to begin with the audit committee should meet at least thrice a year.', 'http://1.bp.blogspot.com/_Pxd0QZ3r8LA/Sit_hXTiVUI/AAAAAAAABy4/GAHWsS17VWg/s320/quorum.jpg', 'http://www.thepictionary.com/2009_06_16_archive.html', 0, 2),
(441, 'raconteur', '(n)', 'a person skilled in telling anecdotes', 'anecdotist', 'The speaker was known to be quite the raconteur so the program was well attended.', 'http://vocabmadeeasy.com/wp-content/uploads/2010/11/raconteur.jpg', 'http://vocabmadeeasy.com/2010/11/r-list-1-5/', 0, 1),
(442, 'rail', '(v)', 'speak against in an impassioned manner', 'declaim', 'Now,who could rail him?', 'http://s3.amazonaws.com/brainyflix/photos/6286/thumb.jpg', 'http://www.gotbrainy.com/words/rail', 0, 3),
(443, 'raiment', '(n)', 'especially fine or decorative clothing', 'array,regalia', '#Grey is their raiment , for the Elves clad them, and thus they have passed through the shadow of great perils to your hall.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2012/06/raiment.gif&h=300&zc=0', 'http://wordpandit.com/2012/Raiment', 0, 3),
(444, 'rebus', '(n)', 'a puzzle where you decode a message consisting of pictures representing syllables and words', '', '#A rebus that couldn''t mean more clearly `Go to Urth, written by a man who was once a student of Urth and would know him.', 'http://1.bp.blogspot.com/_Pxd0QZ3r8LA/S_eDwtnhZCI/AAAAAAAACWE/ZDkwds5MJ7M/s72-c/rebus.jpg', 'http://www.thepictionary.com/?widgetType=BlogArchive&widgetId=BlogArchive1&action=toggle&dir=open&toggle=DAILY-1250620200000&toggleopen=DAILY-1302892200000', 0, 2),
(445, 'recalcitrant', '(adj)', 'easily irritated or annoyed', 'cranky,irritable,nettlesome,peevish,peckish,pettish,petulant,scratchy,testy,tetchy,techy', 'Sid Vicious and the rest of the Punks were recalcitrant.', 'http://s3.amazonaws.com/brainyflix/photos/334/thumb.jpg', 'http://www.gotbrainy.com/words/recalcitrant', 0, 2),
(446, 'recant', '(n)', 'shedding of flowers and leaves and fruit following formation of scar tissue in a plant', 'withdraw, take back, retract, disclaim, deny, recall, renounce, revoke, repudiate, renege, disown, disavow, forswear, abjure, unsay, apostatize,', '#1632: In a public auditory I did heap up all the dicteries I could against women, but now recant.', 'http://img.tfd.com/wn/FD/BF7F1-recant.jpg', 'http://www.thefreedictionary.com/recant', 0, 1),
(447, 'recondite', '(adj)', 'difficult to penetrate; incomprehensible to one of ordinary understanding or knowledge', 'abstruse,deep', '#It is a mine of interesting and recondite information, written by the leading authorities in their fields.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2013/02/Recondite.jpg&h=300&zc=0', 'http://wordpandit.com/2013/Recondite', 0, 2),
(448, 'redoubtable', '(v)', 'formally reject or disavow a formerly held belief, usually under pressure', 'abjure,recant,retract,resile', 'The man had a redoubtably evil face as he was telling the ghost story.', 'http://s3.amazonaws.com/brainyflix/photos/310/thumb.jpg', 'http://www.gotbrainy.com/words/redoubtable', 0, 2),
(449, 'refract', '(v)', 'subject to refraction', '', 'the worker bent the stop sign back to its orignal shape.', 'http://s3.amazonaws.com/brainyflix/photos/3896/thumb.jpg', 'http://www.gotbrainy.com/words/refract', 0, 1),
(450, 'refractory', '(adj)', 'easily irritated or annoyed', 'cranky,irritable,nettlesome,peevish,peckish,pettish,petulant,scratchy,testy,tetchy,techy', '#A factory-built fireplace is a firebox lined with refractory brick panels that resemble mortared firebrick enclosed within a steel cabinet.', 'http://img.tfd.com/wn/64/629D5-refractory.png', 'http://www.thefreedictionary.com/refractory', 0, 3),
(451, 'refulgent', '(adj)', 'radiating or as if radiating light', 'beaming,beamy,effulgent,radiant', '#In Brahms and Beethoven horns rode in refulgent red; no doubt they were hunting.', 'http://1.bp.blogspot.com/_Pxd0QZ3r8LA/RrXnr3ZWWzI/AAAAAAAAAII/IheDgrj2krc/s320/refulgent.jpg', 'http://www.thepictionary.com/search?updated-min=2007-08-01T00:00:00%2B05:30&updated-max=2007-09-01T00:00:00%2B05:30&max-results=4', 0, 1),
(452, 'refute', '(v)', 'overthrow by argument, evidence, or proof', 'rebut', 'einstein was sueprised when he was refuted.', 'http://s3.amazonaws.com/brainyflix/photos/700/thumb.jpg', 'http://www.gotbrainy.com/words/refute', 0, 2);
