(453, 'regale', '(v)', 'provide with choice or abundant food or drink', 'treat', '#-- Less than an hour after his capture in Pakistan in 1995, Ramzi Yousef seemed compelled to regale the agents with his accomplishments.', 'http://1.bp.blogspot.com/_Pxd0QZ3r8LA/Sp5oyvba-_I/AAAAAAAACL0/TH3kHe6ojwc/s320/REGALE.jpg', 'http://www.thepictionary.com/search?updated-min=2009-01-01T00:00:00%2B05:30&updated-max=2010-01-01T00:00:00%2B05:30&max-results=50', 0, 3),
(454, 'relegate', '(v)', 'refer to another person for decision or judgment', 'pass on,submit', 'Harrison was relegated by the government because of his greatness.', 'http://s3.amazonaws.com/brainyflix/photos/10830/thumb.jpg', 'http://www.gotbrainy.com/words/relegate', 0, 1),
