(457, 'reparation', '(n)', 'compensation', 'compensation, damages, repair, satisfaction, amends, renewal, redress, indemnity, restitution, atonement, recompense, propitiation, requital', '#At that point, a process of adoring, tearful reparation can begin.', 'http://img.tfd.com/wn/36/5F9F3-reparation.png', 'http://www.thefreedictionary.com/reparation', 0, 3),
(458, 'reproach', '(n)', 'a mild rebuke or criticism', 'blame, criticize, rebuke, reprimand, abuse, blast, condemn, carpet, flame, discredit, censure, have a go at, scold, disparage, chide, tear into, diss, defame, find fault with, take to task, read the riot act to, reprove, upbraid, lambast(e), bawl out, chew out, tear (someone) off a strip, give a rocket, reprehend', 'Reproaches will bring nothing but series of more reproaches; So be smart, be above the reproaches, and end feuds, my ...', 'http://s3.amazonaws.com/brainyflix/photos/5471/thumb.jpg', 'http://www.gotbrainy.com/words/reproach', 0, 3),
(459, 'reprobate', '(n)', 'a misanthrope who dislikes women in particular', 'woman hater', 'The girl,funny and tall,repudiated that boy in the red.', 'http://s3.amazonaws.com/brainyflix/photos/7491/thumb.jpg', 'http://www.gotbrainy.com/words/reprobate', 0, 2),
(460, 'repudiate', '(v)', 'cast off', 'disown,renounce', 'The kid,twisted and tormented repudiated by all the other kids.', 'http://s3.amazonaws.com/brainyflix/photos/7498/thumb.jpg', 'http://www.gotbrainy.com/words/repudiate', 0, 2),
(461, 'rescind', '(v)', 'cancel officially', 'revoke,annul,lift,countermand,reverse,repeal,overturn,vacate', 'The dog wishes he could rescind chewing up his owner''s favorite shoes.', 'http://s3.amazonaws.com/brainyflix/photos/10656/thumb.jpg_w_500_h_364_ei_07ZYULayCqOVyAHu3oCAAw_zoom_1_iact_hc_vpx_185_vpy_343_dur_143_hovh_191_hovw_263_tx_157_ty_139_sig_115438178494928046729_page_1_tbnh_145_tbnw_193_start_0_ndsp_21_ved_1t-429_r-7_s-0_i-163', 'http://www.gotbrainy.com/words/rescind', 0, 1),
(462, 'resolve', '(n)', 'the ability of a microscope or telescope to measure the angular separation of images that are close together', 'resolving power', 'When you are having conflicts, you need to resolve what is going on.', 'http://s3.amazonaws.com/brainyflix/photos/3117/thumb.jpg', 'http://www.gotbrainy.com/words/resolve', 0, 3),
(463, 'reticent', '(adj)', 'temperamentally disinclined to talk', 'untalkative', 'The bird was reticent to speaking to the other one.', 'http://s3.amazonaws.com/brainyflix/photos/8310/thumb.jpg', 'http://www.gotbrainy.com/words/reticent', 0, 2),
(464, 'reverent', '(adj)', 'feeling or showing profound respect or veneration', 'respectful, awed, solemn, deferential, loving, humble, adoring, devout, pious, meek, submissive, reverential,', '#Donkeys and Shetland ponies respond well to the reverent atmosphere and never bite or kick.', 'http://3.bp.blogspot.com/_Pxd0QZ3r8LA/SiuEg0PGvWI/AAAAAAAABzI/2U1dnaPbqw8/s320/reverent.jpg', 'http://www.thepictionary.com/2009_06_18_archive.html', 0, 3),
(465, 'rococo', '(n)', 'fanciful but graceful asymmetric ornamentation in art and architecture that originated in France in the 18th century', 'extravagant, fancy, elegant, elaborate, baroque, ornamented, ornate, fussy, convoluted, flowery, florid, overelaborate, high-wrought, highly decorated, aureate', '#His standard response to any information is `I used to have one of those, even if it''s a custom-built, rococo cage for twin opossums.', 'http://lh6.ggpht.com/_Pxd0QZ3r8LA/TFpzpmw5SiI/AAAAAAAACZE/8gNO13CGrog/ROCOCO_thumb%5B2%5D.jpg?imgmax=800', 'http://www.thepictionary.com/2010/08/gre-words-647-648.html', 0, 1),
(466, 'rubric', '(n)', 'an authoritative rule of conduct or procedure', '', '#What''s important from my point of view is that under the rubric of the charter we are making the announcement that we are back in business.', 'http://img.tfd.com/wn/C0/65CC8-rubric.png', 'http://www.thefreedictionary.com/rubric', 0, 1),
(467, 'rue', '(n)', 'European strong-scented perennial herb with grey-green bitter-tasting leaves; an irritant similar to poison ivy', 'herb of grace,Ruta graveolens', '#An exquisite new banner that is being stitched even now by a little old lady in the rue Malebranche.', 'http://3.bp.blogspot.com/_Pxd0QZ3r8LA/Sp5i1WzBTUI/AAAAAAAACLU/EcXfHxdVrfg/s320/CONSTRUE.jpg', 'http://www.thepictionary.com/search?updated-min=2009-09-01T00:00:00%2B05:30&updated-max=2009-10-01T00:00:00%2B05:30&max-results=8', 0, 3),
(468, 'ruse', '(n)', 'a deceptive maneuver', 'artifice', 'The magician used a clever ruse to fool his audience into thinking that the object was floating.', 'http://s3.amazonaws.com/brainyflix/photos/11684/thumb.jpg', 'http://www.gotbrainy.com/words/ruse', 0, 2),
(469, 'sage', '(n)', 'a mentor in spiritual and philosophical topics who is renowned for profound wisdom', 'wise man, philosopher, guru, authority, expert, master, elder, pundit, Solomon, mahatma, Nestor, savant, Solon, man of learning, tohunga', '#Add some crushed garlic, freshly-ground black pepper and sage.', 'http://2.bp.blogspot.com/_Pxd0QZ3r8LA/RqyQmbXS2RI/AAAAAAAAAFg/kRdjLn-5R7w/s320/archway--curved+structure+forming+passage+or+entrance.jpg', 'http://www.thepictionary.com/search?updated-min=2008-01-01T00:00:00%2B05:30&updated-max=2008-02-01T00:00:00%2B05:30&max-results=3', 0, 3),
