(472, 'satiate', '(v)', 'fill to satisfaction', 'sate,replete,fill', 'Special agent 009 will stop at nothing to satiate his desire for cheese', 'http://s3.amazonaws.com/brainyflix/photos/1155/thumb.gif', 'http://www.gotbrainy.com/words/satiate', 0, 1),
