(474, 'savor', '(n)', 'the taste experience when a savoury condiment is taken into the mouth', 'relish,flavor,flavour,sapidity,savour,smack,nip,tang', 'When you like to savor this is right around the corner.', 'http://s3.amazonaws.com/brainyflix/photos/11076/thumb.jpg', 'http://www.gotbrainy.com/words/savor', 0, 2),
(475, 'sensual', '(adj)', 'marked by the appetites and passions of the body', 'animal,carnal,fleshly', 'Hand-painted fabric is the newest artistic form of sensual fashion for the anything goes crowd.', 'http://s3.amazonaws.com/brainyflix/photos/5882/thumb.jpg', 'http://www.gotbrainy.com/words/sensual', 0, 3),
