(479, 'simile', '(n)', 'a figure of speech that expresses a resemblance between things of different kinds', '', '#12. What is the missing word in the simile ``to grin like a... cat ''?', 'http://img.tfd.com/wn/3C/BFB22-facsimile.jpg', 'http://www.thefreedictionary.com/simile', 0, 3),
(480, 'singular', '(n)', 'the form of a word that is used to denote a singleton', 'singular form', '#A man''s will, he believed, the will to power over himself, was a singular , godlike quality.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2012/11/Singular.jpg&h=300&zc=0', 'http://wordpandit.com/2012/Singular', 0, 3),
(481, 'sinuous', '(adj)', 'curved or curving in and out', 'sinuate,wiggly', 'Sinuous roads make me nauseous.', 'http://s3.amazonaws.com/brainyflix/photos/7137/thumb.jpg', 'http://www.gotbrainy.com/words/sinuous', 0, 2),
(482, 'skeptic', '(n)', 'someone who habitually doubts accepted beliefs', 'sceptic,doubter', '#Boston Public (tonight, Fox, Global, 9 p. m.) has the former skeptic turned Dubya-apologist Dennis Miller playing a nasty piece of work.', 'http://img.tfd.com/wn/5A/697B1-skeptic.jpg', 'http://www.thefreedictionary.com/skeptic', 0, 1),
(483, 'sobriety', '(n)', 'the state of being sober and not intoxicated by alcohol', 'soberness', 'Prohibition, in many ways, was counteractive to sobriety.', 'http://s3.amazonaws.com/brainyflix/photos/10529/thumb.jpg', 'http://www.gotbrainy.com/words/sobriety', 0, 3),
(484, 'solicitous', '(adj)', 'full of anxiety and concern', 'concerned, caring, attentive, careful', 'Hes solicitous because its past 10 and his son isn''t home.', 'http://s3.amazonaws.com/brainyflix/photos/7151/thumb.jpg', 'http://www.gotbrainy.com/words/solicitous', 0, 3),
(485, 'soliloquy', '(n)', 'speech you make to yourself', 'monologue', '# soliloquy might have succeeded in doing just that if he hadn''t been in love and overflowing with a marvellous sense of aliveness.', 'http://img.tfd.com/wn/B0/66324-soliloquy.png', 'http://www.thefreedictionary.com/soliloquy', 0, 2),
(486, 'solvent', '(n)', 'a decision to do something or to behave in a certain manner', 'financially sound, secure, in the black, solid, profit-making, in credit, debt-free, unindebted', 'I heard California is still not SOLVENT.', 'http://s3.amazonaws.com/brainyflix/photos/1484/thumb.jpg', 'http://www.gotbrainy.com/words/solvent', 0, 2),
(487, 'soporific', '(n)', 'a drug that induces sleep', 'hypnotic', '#One side of the (cold) tablet is a stimulant, the other is a soporific , he said.', 'http://1.bp.blogspot.com/_Pxd0QZ3r8LA/SOXW3urvKBI/AAAAAAAABAw/V6kc4PgjkXU/s320/soporific.jpg', 'http://www.thepictionary.com/search?updated-min=2008-01-01T00:00:00%2B05:30&updated-max=2009-01-01T00:00:00%2B05:30&max-results=27', 0, 1),
(488, 'sordid', '(adj)', 'morally degraded', 'seamy,seedy,sleazy,squalid', 'This turkey is so sordid looking, eating it is unthinkable.', 'http://s3.amazonaws.com/brainyflix/photos/4770/thumb.jpg', 'http://www.gotbrainy.com/words/sordid', 0, 3),
(489, 'specious', '(v)', 'attract strongly, as if with a magnet', 'magnetize,mesmerise,magnetise,bewitch,spellbind', '#They''ve also managed to reduce the number of specious investigations, such as false allegations in child custody battles.', 'http://img.tfd.com/wn/9E/17F8D0-specious.jpg', 'http://www.thefreedictionary.com/specious', 0, 3),
(490, 'sporadic', '(adj)', 'recurring in scattered and irregular or unpredictable instances', 'intermittent, occasional, scattered, isolated, random, on and off, irregular, infrequent, spasmodic, scattershot,', '#Although there may be sporadic cases, most of the weekly reports coming in now are comprised of a backlog of cases.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2012/04/sporadic.jpg&h=300&zc=0', 'http://wordpandit.com/2012/Sporadic', 0, 2),
(491, 'stigma', '(n)', 'the apical end of the style where deposited pollen enters the pistil', 'disgrace, shame, dishonour, mark, spot, brand, stain, slur, blot, reproach, imputation, smirch', ' We were now face to face with this man of diverse talent - poet, novelist, song-writer, performer - after following his career for nearly two decades, reading his books, playing his records, watching him sing, reading of him through the eyes of his critics - no easy feat when one is not inhibited by astigmatism!', 'http://catmantra.com/cache/com_zoo/images/astigmatism_b46136bc7e0376624cd9fdfaca04bf9a.jpg', 'http://catmantra.com/index.php/cat-word-list/23', 0, 2),
(492, 'stipulate', '(v)', 'describe or portray the character or the qualities or peculiarities of', 'qualify,characterize,characterise', '#'' Apart from outlining funding, the five-year Australian Health Care Agreements also stipulate standards that should be met.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2012/04/stipulate.jpg&h=300&zc=0', 'http://wordpandit.com/2012/Stipulate', 0, 1),
(493, 'stolid', '(adj)', 'deliberately impassive in manner', 'deadpan,expressionless,poker-faced,unexpressive', 'A stolid Wolverine doesn''t even look back at explosions.', 'http://s3.amazonaws.com/brainyflix/photos/9914/thumb.jpg', 'http://www.gotbrainy.com/words/stolid', 0, 3),
(494, 'stratified', '(v)', 'divide society into social classes or castes', 'stratify', '#Everything is so stratified over there, it all depends on who your father is.', 'http://img.tfd.com/wn/65/11E4D0-stratified.jpg', 'http://www.thefreedictionary.com/stratified', 0, 2),
(495, 'stricture', '(n)', 'abnormal narrowing of a bodily canal or passageway', 'stenosis', '#At the time of referral, she was awaiting surgery for a colonic stricture resulting from a recurrence of carcinoma of the colon.', 'http://img.tfd.com/wn/EE/6CD23-stricture.png', 'http://www.thefreedictionary.com/stricture', 0, 3),
(496, 'strident', '(adj)', 'conspicuously and offensively loud; given to vehement outcry', 'blatant,clamant,clamorous,vociferous', 'Criying in the store, the strident baby screamed at the top of its lungs.', 'http://s3.amazonaws.com/brainyflix/photos/7398/thumb.jpg', 'http://www.gotbrainy.com/words/strident', 0, 2),
(497, 'stupefy', '(adj)', 'filled with bewilderment', 'at a loss,nonplused,puzzled', 'The little monster was stupefied by the kid.', 'http://s3.amazonaws.com/brainyflix/photos/8285/thumb.jpg', 'http://www.gotbrainy.com/words/stupefy', 0, 1),
(498, 'substantiate', '(adj)', 'possessing or existing in bodily form', 'bodied,corporal,corporate,embodied', '#But you are aware of course that you have completely failed so far to substantiate any of your accusations against my client.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2012/07/substantiate.jpg&h=300&zc=0', 'http://wordpandit.com/2012/Substantiate', 0, 3),
(499, 'suffrage', '(n)', 'a legal right guaranteed by the 15th amendment to the US Constitution; guaranteed to women by the 19th amendment', 'right to vote,vote', '#But the geographical constituencies, decided by universal suffrage , are regarded as the most representative.', 'http://img.tfd.com/wn/02/64504-suffrage.png', 'http://www.thefreedictionary.com/suffrage', 0, 3),
(500, 'supine', '(adj)', 'lying face upward', 'resupine', '#And the crushing burden of UNMIK''s layers of bureaucracy has left Kosovo''s indigenous political institutions supine and powerless.', 'http://1.bp.blogspot.com/_Pxd0QZ3r8LA/SiVFujz7gMI/AAAAAAAABpI/YzSa6TZAMw8/s320/supine.jpg', 'http://www.thepictionary.com/2009_06_01_archive.html', 0, 3),
(501, 'supplant', '(v)', 'take the place or move into the position of', 'replace,supersede,supervene upon', 'This 4th of July I will supplant Kobayashi as the hot dog eating champ of the world!!!!!!!', 'http://s3.amazonaws.com/brainyflix/photos/1452/thumb.jpg', 'http://www.gotbrainy.com/words/supplant', 0, 2),
(502, 'tacit', '(adj)', 'implied by or inferred from actions or statements', 'silent,understood', '#Amid the flickering candles on Christmas Eve, the retrieval of corpses and their burial were tacit preconditions for.', 'http://dailyvocab.com/wp-content/uploads/2013/10/taciturn.jpg', 'http://dailyvocab.com/wordlist/cat/page/6', 0, 3),
(503, 'talisman', '(n)', 'something located at a time when it could not have existed or occurred', 'mistiming,misdating', 'The old lady wore a talisman around her neck.', 'http://vocabmadeeasy.com/wp-content/uploads/2010/11/talisman.jpg', 'http://vocabmadeeasy.com/2010/11/t-list-1-5/', 0, 2),
(504, 'tenuous', '(adj)', 'having thin consistency', 'slight, weak, dubious, shaky, doubtful, questionable, insignificant, flimsy, sketchy, insubstantial, nebulous,', '''ascii'' codec can''t encode character u''u201c'' in position 96: ordinal not in range(128)', 'http://s3.amazonaws.com/brainyflix/photos/7948/thumb.jpg', 'http://www.gotbrainy.com/words/tenuous', 0, 1),
(505, 'terrestrial', '(adj)', 'belonging to this earth or world; not ideal or heavenly', 'terrene', 'The panda lives on earth and is a terrestrial animal.', 'http://s3.amazonaws.com/brainyflix/photos/10128/thumb.jpeg', 'http://www.gotbrainy.com/words/terrestrial', 0, 3),
(506, 'timbre', '(n)', ' the distinctive tone quality differentiating one vowel or sonant from another', 'timber,quality,tone', '#It was the first time Andrew had spoken in court and the Judge seemed astonished for a moment at the human timbre of the voice.', 'http://img.tfd.com/wn/E4/641FB-timbre.jpg', 'http://www.thefreedictionary.com/timbre', 0, 1),
(507, 'tirade', '(n)', 'a speech of violent denunciation', 'philippic,broadside', 'This lady gave a tirade at the tournament.', 'http://s3.amazonaws.com/brainyflix/photos/6107/thumb.jpg', 'http://www.gotbrainy.com/words/tirade', 0, 2),
(508, 'toady', '(n)', 'a person who tries to please someone in order to gain a personal advantage', 'sycophant,crawler,lackey,ass-kisser', 'Only toadies would use trinkets like this to gain the teacher''s trust.', 'http://s3.amazonaws.com/brainyflix/photos/6355/thumb.jpg', 'http://www.gotbrainy.com/words/toady', 0, 1),
(509, 'tome', '(n)', 'a (usually) large and scholarly book', 'book, work, title, volume, opus, publication', 'The majority of teenagers like to read the tome Twilight.', 'http://s3.amazonaws.com/brainyflix/photos/2509/thumb.jpg', 'http://www.gotbrainy.com/words/tome', 0, 2),
(510, 'torpor', '(n)', 'a state of motor and mental inactivity with a partial suspension of sensibility', 'torpidity', '#After a few days Michael and Rosario returned home, where he would continue to read even in the summery torpor of southern California.', 'http://img.tfd.com/wn/9D/6CBB9-torpor.jpg', 'http://www.thefreedictionary.com/torpor', 0, 2),
(511, 'tortuous', '(adj)', 'large in number or quantity', 'voluminous', 'The acrobat performed tortuous stunts that I could barely follow with my eyes.', 'http://s3.amazonaws.com/brainyflix/photos/6352/thumb.jpg', 'http://www.gotbrainy.com/words/tortuous', 0, 2),
(512, 'tout', '(n)', 'someone who buys tickets to an event in order to resell them at a profit', 'ticket tout', '#But enthusiasts even tout that XML has the potential to double up as a knowledge management solution.', 'http://1.bp.blogspot.com/_Pxd0QZ3r8LA/SsSBYYQRRVI/AAAAAAAACNA/3tS2jARpZP4/s320/tout.jpg', 'http://www.thepictionary.com/search?updated-min=2009-01-01T00:00:00%2B05:30&updated-max=2010-01-01T00:00:00%2B05:30&max-results=50', 0, 3),
(513, 'tractable', '(adj)', 'open to being acted upon in a certain way', 'manageable, obedient, compliant, willing, yielding, tame, amenable, submissive, docile, controllable, biddable, persuadable, governable,', 'My wife thinks I''m extremely tractable but I''m not! Coming honey!', 'http://s3.amazonaws.com/brainyflix/photos/8602/thumb.jpg', 'http://www.gotbrainy.com/words/tractable', 0, 2),
(514, 'transient', '(n)', 'steadiness of mind under stress', 'composure,calm,calmness', 'The transient noise was very faint.', 'http://s3.amazonaws.com/brainyflix/photos/9948/thumb.webloc', 'http://www.gotbrainy.com/words/transient', 0, 3),
(515, 'travail', '(n)', 'concluding state of pregnancy; from the onset of contractions to the birth of a child', 'parturiency,labor,labour,confinement,lying-in,childbed', '#And well for you that this is so, for if you forfeit the ecstasy, so also do you miscarry of the travail.', 'http://img.tfd.com/wn/3D/C10AE-travail.jpg', 'http://www.thefreedictionary.com/travail', 0, 3),
(516, 'travesty', '(n)', 'a comedy characterized by broad satire and improbable situations', 'farce,farce comedy', 'It''s a travesty when the guard dog is as surprised as you are about the robbery.', 'http://s3.amazonaws.com/brainyflix/photos/6359/thumb.jpg', 'http://www.gotbrainy.com/words/travesty', 0, 2),
(517, 'treatise', '(n)', 'a formal exposition', 'paper, work, writing, study, essay, thesis, tract, pamphlet, exposition, dissertation, monograph, disquisition', '#But if you think this produces a somewhat dreary treatise , you''re wrong.', 'http://img.tfd.com/wn/CB/657AA-treatise.png', 'http://www.thefreedictionary.com/treatise', 0, 3),
(518, 'tremulous', '(adj)', 'vibrating slightly; quavering; trembling', 'quavering', 'The little girl was tremulous at the sight of the clown.', 'http://s3.amazonaws.com/brainyflix/photos/949/thumb.jpg', 'http://www.gotbrainy.com/words/tremulous', 0, 3),
(519, 'trepidation', '(n)', 'a feeling of alarm or dread', 'anxiety, fear, worry, alarm, emotion, excitement, dread, butterflies, shaking, disturbance, dismay, trembling, fright, apprehension, tremor, quivering, nervousness, disquiet, agitation, consternation, jitters, cold feet, uneasiness, palpitation, cold sweat, perturbation, blue funk, the heebie-jeebies,', 'Cornered, John went straight into his fallback plan with little trepidation--stall for time by acting crazy.', 'http://s3.amazonaws.com/brainyflix/photos/13/thumb.', 'http://www.gotbrainy.com/words/trepidation', 0, 2),
(520, 'tryst', '(n)', 'a date; usually with a member of the opposite sex', 'rendezvous', '#But such a thing has not happened before, that Gandalf broke tryst and did not come when he promised.', 'http://img.tfd.com/wn/4B/608AB-tryst.png', 'http://www.thefreedictionary.com/tryst', 0, 2),
(521, 'tumid', '(adj)', 'ill-mannered and coarse and contemptible in behavior or appearance', 'loutish,neanderthal,neandertal,oafish,swinish', ' abnormally distended especially by fluids or gas', 'http://img.tfd.com/wn/25/17E970-tumid.png', 'http://www.thefreedictionary.com/tumid', 0, 1),
(522, 'turbid', '(adj)', 'muddy or opaque, as a liquid clouded with a suspension of particles', 'cloudy,muddy,mirky,murky', '#After a while, the sky fell cloudy and grey, and the waters of the Sound were as dark and turbid with sediments as old wine.', 'http://1.bp.blogspot.com/-aVnF86RxP48/TZbnNC_rfiI/AAAAAAAAChs/4Vm0aLq21MI/s320/turbid.jpg', 'http://www.thepictionary.com/?widgetType=BlogArchive&widgetId=BlogArchive1&action=toggle&dir=open&toggle=DAILY-1250620200000&toggleopen=DAILY-1302892200000', 0, 2),
(523, 'turgid', '(adj)', 'ill-mannered and coarse and contemptible in behavior or appearance', 'loutish,neanderthal,neandertal,oafish,swinish', '''ascii'' codec can''t encode character u''u2019'' in position 62: ordinal not in range(128)', 'http://s3.amazonaws.com/brainyflix/photos/2270/thumb.jpg', 'http://www.gotbrainy.com/words/turgid', 0, 1),
(524, 'tutelary', '(adj)', 'providing protective supervision; watching over or safeguarding', 'custodial,tutelar', '#Again, he faced the tutelary computer, letting the stream of his turbulent, half-formed thoughts flow freely.', 'http://4.bp.blogspot.com/_Pxd0QZ3r8LA/Si9cc7gPg4I/AAAAAAAAB84/BoUPdKJQHOI/s320/tutelary.jpg', 'http://www.thepictionary.com/2009_07_19_archive.html', 0, 1),
(525, 'uncanny', '(adj)', 'suggesting the operation of supernatural influences', 'eldritch,weird,unearthly', 'My eyes have fallen out! What an uncanny occurrence!', 'http://s3.amazonaws.com/brainyflix/photos/5444/thumb.jpg', 'http://www.gotbrainy.com/words/uncanny', 0, 3),
(526, 'untoward', '(adj)', 'not in keeping with accepted standards of what is right or proper in polite society', 'indecent,indecorous,unbecoming,uncomely,unseemly', ' contrary to your interests or welfare', 'http://img.tfd.com/wn/AC/17E6BA-untoward.jpg', 'http://www.thefreedictionary.com/untoward', 0, 2),
(527, 'usury', '(n)', 'an exorbitant or unlawful rate of interest', 'vigorish', '#And they get whacked on fees that have nothing to do with cost recovery, but are straight usury.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2011/12/usury.gif&h=300&zc=0', 'http://wordpandit.com/2011/Usury', 0, 2),
(528, 'vacillate', '(v)', 'move or swing from side to side regularly', 'vibrate', 'Cooking kitteh vacillated to finish the product for the special formula to not disappoint his master.', 'http://s3.amazonaws.com/brainyflix/photos/7302/thumb.jpg', 'http://www.gotbrainy.com/words/vacillate', 0, 1),
(529, 'vacuous', '(adj)', 'devoid of intelligence or thought', 'mindless', 'The trash can is vacuous.', 'http://s3.amazonaws.com/brainyflix/photos/445/thumb.JPG', 'http://www.gotbrainy.com/words/vacuous', 0, 1),
(530, 'valedictory', '(n)', 'a farewell oration', 'valediction,valedictory address,valedictory oration', '#''18 As the threat of his `modest pen '' implied, Belloc''s valedictory address to Parliament was by no means a farewell to politics.', 'http://img.tfd.com/wn/2D/66468-valedictory.png', 'http://www.thefreedictionary.com/valedictory', 0, 3),
(531, 'vapid', '(adj)', 'lacking interest or significance or impact', 'jejune', 'The party became vapid when the music was turned off.', 'http://s3.amazonaws.com/brainyflix/photos/8861/thumb.JPG', 'http://www.gotbrainy.com/words/vapid', 0, 2),
(532, 'variegated', '(v)', 'change the appearance of, especially by marking with different colors', 'variegate', 'The man wanted variegated variances from politicians that were genuine and not specious.', 'http://s3.amazonaws.com/brainyflix/photos/4552/thumb.jpg', 'http://www.gotbrainy.com/words/variegated', 0, 3),
(533, 'vaunt', '(adj)', 'easily managed', 'manipulable', '#''Shall the axe vaunt itself over him who hews with it, or the saw magnify itself against him who wields it?', 'http://img.tfd.com/wn/13/66434-vaunt.png', 'http://www.thefreedictionary.com/vaunt', 0, 2),
(534, 'venal', '(adj)', 'capable of being corrupted', 'corruptible,bribable,dishonest,purchasable', '#In Protestant western Europe the papacy has for centuries been viewed as a corrupt and venal institution.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2011/09/venal.gif&h=300&zc=0', 'http://wordpandit.com/2011/Venal', 0, 2),
(535, 'venerate', '(v)', 'regard with feelings of respect and reverence; consider hallowed or exalted or be in awe of', 'reverence,fear,revere', 'FCCLA venerated the cause to help fight for Breast Cancer.', 'http://s3.amazonaws.com/brainyflix/photos/7922/thumb.JPG', 'http://www.gotbrainy.com/words/venerate', 0, 1),
(536, 'veracious', '(adj)', 'habitually speaking the truth', 'truthful, frank, ethical, honest, trustworthy, high-principled, veridical', 'There wasn''t a vestige of veracity to jeff''s story.', 'http://s3.amazonaws.com/brainyflix/photos/10522/thumb.jpg', 'http://www.gotbrainy.com/words/veracious', 0, 3),
(537, 'verbose', '(adj)', 'using or containing too many words', 'long-winded,tedious,windy,wordy', 'This man definitly needs to learn to not be so verbose', 'http://s3.amazonaws.com/brainyflix/photos/10480/thumb.jpg', 'http://www.gotbrainy.com/words/verbose', 0, 1),
(538, 'vertigo', '(n)', 'a reeling sensation; a feeling that you are about to fall', 'dizziness,giddiness,lightheadedness', '#And who can ever forget the vertigo of fear and the incandescent rage that swept the country as South Africa faced the abyss?', 'http://4.bp.blogspot.com/_Pxd0QZ3r8LA/SOSS1KuxifI/AAAAAAAAA_Y/V0bizhrIUEU/s320/vertigo.jpg', 'http://www.thepictionary.com/2008_10_02_archive.html', 0, 1),
(539, 'vexation', '(n)', 'anger produced by some annoying irritation', 'annoyance,chafe', '#Even in the dark with only the starlight, I saw how his eyes blazed with vexation.', 'http://img.tfd.com/wn/48/64EDF-vexation.png', 'http://www.thefreedictionary.com/vexation', 0, 3),
(540, 'viable', '(adj)', 'capable of being done with means at hand and circumstances as they are', 'feasible,executable,practicable,workable', '#A spokesperson for the council explained:''Planning & Regeneration Officers continue to work to secure a viable future for Gwrych.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2012/04/viable.jpg&h=300&zc=0', 'http://wordpandit.com/2012/Viable', 0, 1),
(541, 'vindictive', '(adj)', 'disposed to seek revenge or intended for revenge', 'revengeful,vengeful', 'Tom and Jerry are very vindictive. They are always out to seek revenge on each other.', 'http://s3.amazonaws.com/brainyflix/photos/11757/thumb.jpg', 'http://www.gotbrainy.com/words/vindictive', 0, 3),
(542, 'virtuoso', '(v)', 'protect or fight for as a champion', 'defend', '#A smirking Stan followed him, leaving them in stunned silence over such a virtuoso performance.', 'http://dailyvocab.com/wp-content/uploads/2013/10/virtuoso.jpg', 'http://dailyvocab.com/wordlist/cat/page/4', 0, 2),
(543, 'visage', '(adj)', 'having an agreeably pungent taste', 'savory,savoury,zesty', '#A millimetre here, a millimetre there, and the whole visage was somehow distorted, though its beauty remain_temped undiminished.', 'http://img.tfd.com/wn/7D/63D48-visage.jpg', 'http://www.thefreedictionary.com/visage', 0, 3),
(544, 'viscous', '(adj)', 'having a relatively high resistance to flow', 'syrupy', 'The viscous water is being held back by the bever''s dam.', 'http://s3.amazonaws.com/brainyflix/photos/7774/thumb.gif', 'http://www.gotbrainy.com/words/viscous', 0, 1),
(545, 'vituperative', '(adj)', 'marked by harshly abusive criticism', 'scathing', '#There''s a vituperative (fair play Martyr using a word like that live on the telly) journalist who said Lennon is negative, he blasted.', 'http://img.tfd.com/wn/A6/17E169-vituperative.jpg', 'http://www.thefreedictionary.com/vituperative', 0, 1),
(546, 'vogue', '(n)', 'the popular taste at a given time', 'trend,style', '#A vogue for Indian fashion predominated among the young, who wanted to distance themselves as much as possible from their bourgeois parents.', 'http://wordpandit.com/wp-content/themes/DynamiX/lib/scripts/timthumb.php?src=/wp-content/uploads/2013/02/Vogue.jpg&h=300&zc=0', 'http://wordpandit.com/2013/Vogue', 0, 3),
(547, 'volatile', '(n)', 'a volatile substance; a substance that changes readily from solid or liquid to a vapor', 'changeable, shifting, variable, unsettled, unstable, explosive, unreliable, unsteady, inconstant,', '#But in the current volatile market, historic earnings growth is a shaky foundation for coming up with a reliable valuation, he added.', 'http://img.tfd.com/wn/03/120815-volatile.png', 'http://www.thefreedictionary.com/volatile', 0, 3),
(548, 'wary', '(adj)', 'marked by keen caution and watchful prudence', 'suspicious, sceptical, mistrustful, suspecting, guarded, apprehensive, cagey, leery, distrustful, on your guard, chary, heedful', '#Be wary in particular these days of the new trend in interest free credit for a number of months.', 'http://1.bp.blogspot.com/_Pxd0QZ3r8LA/SixlFJweSlI/AAAAAAAAB04/IB6j8vhNtPQ/s320/wary.jpg', 'http://www.thepictionary.com/search?updated-min=2009-06-01T00:00:00%2B05:30&updated-max=2009-07-01T00:00:00%2B05:30&max-results=31', 0, 3),
(549, 'welter', '(n)', 'a confused multitude of things', 'clutter,jumble,muddle,fuddle,mare''s nest,smother', '#Along with 120,000 fans she feared the worst as his Ferrari disintegrated in a welter of flying metal.', 'http://4.bp.blogspot.com/_Pxd0QZ3r8LA/SOSWKVWYPtI/AAAAAAAAA_o/_Nkn3tp3Qn0/s320/6D323-welter.gif', 'http://www.thepictionary.com/2008_10_02_archive.html', 0, 2),
(550, 'whimsical', '(n)', 'spontaneously fanciful or playful', 'fanciful, odd, funny, unusual, fantastic, curious, weird, peculiar, eccentric, queer, flaky, singular, quaint, playful, mischievous, capricious, droll, freakish, fantastical, crotchety, chimerical, waggish', 'You don''t always have to be so serious, Be Whimsical once in a while.', 'http://s3.amazonaws.com/brainyflix/photos/7695/thumb.jpg', 'http://www.gotbrainy.com/words/whimsical', 0, 3),
(551, 'wistful', '(adj)', 'showing pensive sadness', 'pensive', 'The cat looked wistfully at his food. (Kiara)', 'http://s3.amazonaws.com/brainyflix/photos/10961/thumb.jpg', 'http://www.gotbrainy.com/words/wistful', 0, 3);
